import './App.css';
import logo from './images/logo.svg'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className='logo'>
          <img src={logo} alt="logo"></img>
          <p> <strong>Will</strong>Verso </p>
        </div>
      </header>
    </div>
  );
}

export default App;
